import React from 'react';

const SearchBar = ({ setSearchQuery }) => {
  return (
    <input 
      type="text" 
      placeholder="Search by ID, Name, or Email" 
      onKeyUp={(e) => setSearchQuery(e.target.value)} 
    />
  );
};

export default SearchBar;
